export default {
  data() {
    return {
      active: true,
      armyClothes: [{
        id: 0,
        name: "BMW M5 E60 [P228OV22]"
      }, {
        id: 1,
        name: "BMW M5 E25 [P222OV11]"
      }],
      TitleName: "BuyCarMenu"
    };
  },
  methods: {
    setData(data) {
      this.$recursiveAssign(data, this.$data);
    },
    selectArmyClothesMenu(e) {
      this.$callClient("selectSellingItem", e);
    },
    hideArmyClothesMenu() {
      this.AppClose();
    },
    onKeyUp(e) {
      if (e.keyCode === 27 && !window.isModalShow) {
        // Escape
        this.AppClose();
      }
    },
    AppClose() {
      this.$callClient('CloseSellingMenu');
    }
  },
  mounted() {
    window.addEventListener("keyup", this.onKeyUp);
    this.$onClient("W:SellCarMenu:SetData", this.setData);
    this.$callClient("C:SellCarMenu:BrowserReady");
  },
  beforeUnmount() {
    window.removeEventListener("keyup", this.onKeyUp);
    this.$offClient("W:SellCarMenu:SetData", this.setData);
  }
};
